class Solution:
    def isAnagram(self, s: str, t: str) -> bool:
        if len(s) != len(t):
            return False

        store = {}

        for letter in s:
            if letter in store:
                store[letter] += 1
            else:
                store[letter] = 1

        for letter in t:
            if letter in store:
                store[letter] -= 1
            else:
                store[letter] = 1

        for key in store:
            if store[key]!= 0:
                return False
        return True



