I just found another recursive way of going about this if it helps anyone

class Solution:
    def numDecodings(self, s: str) -> int:


        memo={}

        def recur(i):
            if(i==len(s)):
                return 1
            if(s[i]=="0"):
                return 0
            if(i in memo):
                return memo[i]

            res=0
            res+=recur(i+1)
            if(i+1<len(s) and ((int(s[i])==2 and int(s[i+1])<=6) or (int(s[i])==1))):
                res+=recur(i+2)

            memo[i]=res
            return res

        return recur(0)
